import React from 'react'
import gql from 'graphql-tag';
import { Query } from 'react-apollo';


const LAUNCHES_QUERY = gql`
  query LaunchesQuery {
    launches {
      flight_number
      mission_name
      launch_date_local
      launch_success
    }
  }
`;

export default function Posts() {
  return (
    <div className="my-5 text-light bd-secondary">
      <h4>The title</h4>
      <p>lorem </p>
    </div>
  )
}
